Information
------------------------------

People Smuggler: World's Most Wanted
Join Sky's Alex Crawford on the hunt for the world's most wanted people smuggler. Travel through some of the most inhospitable and dangerous places on Earth, as we follow the key human trafficking routes through Libya and onto the Mediterranean Sea. Meet the migrants willing to risk everything in search of a better life and see the horrendous conditions many of them have to endure. Plus, hear from the authorities faced with the &quot;hopeless&quot; task of policing Libya's porous border.
On the smuggling routes we followed through Libya, we witnessed a fractured country with little law and order and where corruption is rife. Witnesses, migrants, survivors, police and border guards all spoke of endemic corruption where it is the smugglers who have the money, the power and the weapons.

